frappe.web_form.on('route_id', function(fieldname, control) {
    console.log('hello')
    var routeId = frappe.web_form.doc.route_id;
    var pickupPointField = frappe.web_form.get_field('pickup_point');

    if (routeId == 'AK01-TARAMANI - THAIYUR') {
        pickupPointField.df.options = [
            'shollinganallur', 'Semmancheri', 'Navalur', 'Padur', 'Kelambakkam', 'Cosmos City', 'Thaiyur'
        ];
        pickupPointField.refresh();
    } else if (routeId == 'AK02-THAIYUR-GUDVANCHERRY') {
        pickupPointField.df.options = ['OMR', 'Gudavanchery'];
        pickupPointField.refresh();
    }
});
